_UI_ContestType_id_description = Eine Bezeichnung, die den Wettkampf eindeutig identifiziert der Form: '_<Datum>-<wettkampfname>' Beispiel '_2014-03-01-reife-jahresringe'. Darf keine Leerzeichen enthalten und muss mit einem Unterstrich oder Buchstaben beginnen. Die ID wird nur für maschinelle Weiterverarbeitung der Daten verwendet, beispielsweise wenn mehrere Wettkämpfe verglichen werden sollen.
_UI_ContestType_name_description = Name des Wettkampfes wie er in Ausschreibungen und Protokollen erscheint.
_UI_ContestType_date_description = Datum, an dem der Wettkampf stattfindet. Das Format ist 2014-03-01 für den 1.März 2014. Bei mehrtägigen Wettkämpfen ist der erste Tag anzugeben. Die angezeigte Uhrzeit ist nicht notwendig und programmatisch bedingt.
_UI_ContestType_class_description = Wettkampfklassen sind jeweils Einteilungen, für die es eine Siegerehrung gibt. Beispielsweise 'Kinder weiblich KM4', 'Mannschaft weiblich KM4' aber auch 'Finale weiblich KM4 Boden'.
_UI_ContestType_chain_description = Riegen sind Gruppen von Wettkämpfern, die gemeinsam einen Gerätewechsel durchführen.
_UI_ContestType_juri_description = Kampfgerichte sind Gruppen von Kampfrichtern, die gemeinsam eine oder mehrere Disziplinen bewerten.
_UI_ContestType_station_description = Eine Station oder auch Gerät ist ein Abschnitt im Wettkampf, zu dem die Riegen wechseln können. So gibt es beispielsweise bei einem Wettkampf mit 2 Gerätekreisen die Stationen: 'Sprung 1', 'Sprung 2', 'Stuba 1', 'Stuba 2', 'Balken 1', 'Balken 2', 'Boden 1', 'Boden 2'
_UI_ContestType_version_feature = Version
_UI_ClassType_diszipline_description = Wettkampfdisziplinen die innerhalb einer Wettkampfklasse durchgeführt werden. Beispiele sind 'Sprung', 'Stuba', 'Balken' und 'Boden'. Zu beachten ist, dass jede Wettkampfklasse eigene Disziplinen enthält. So ist die Disziplin 'Boden' in der Wettkampfklasse 'weiblich Kinder KM4' etwas anderes als die Disziplin 'Boden' in der Wettkampfklasse 'weiblich Jugend KM4' oder in der Wettkampfklasse 'Mannschaft weiblich KM4'
_UI_ClassType_winner_description = Wettkampfteilnehmer die in einer Wettkampfklasse die Besten ermitteln. Dabei kann ein Wettkampfteilnehmer ein einzelner Wettkämpfer als auch (bei Mannschaftswettkampfklassen) eine Mannschaft sein.
_UI_ClassType_name_description = Verständlicher Name der Wettkampfklasse. Dieser Name wird auch in Protokollen und Ausschreibungen verwendet. Beispiel 'weiblich Kinder KM4', 'Finale Boden weiblich Kinder KM4', 'Mannschaft KM4'
_UI_ClassType_calculationkey_description = Berechnungsschlüssel, wie die einzelnen Wertungen zusammengerechnet werden müssen. Beispiel, wenn nur die 3 besten Geräte gewertet werden sollen: 'best(3)', wenn nur die Finalwertung ( zeichnet sich aus, dass entsprechende Disziplin 'finals' in der id enthaelt ) genommen werden soll: 'finals'. 'bestofteam(3)' wenn die besten 3 Wertungen einer Mannschaft genommen werden sollen.
_UI_WinnerType_id_description = Eindeutige einzigartige Bezeichnung des Wettkämpfers. Diese ID wird zum Beispiel dafür verwendet, um einzelne Wettkämpfer Mannschaften zuzuordnen. Diese ID darf keine Leerzeichen enthalten und muss mit einem Buchstaben oder '_' beginnen. Beispiel ist 'starter-3451'
_UI_WinnerType_name_description = Name eines Wettkämpfers bzw. einer Mannschaft. Gewöhnlich wird der Name von Vor- und Familiennamen der Person abgeleitet.
_UI_WinnerType_result_description = Die errechnete Gesamtwertung eines Wettkämpfers bzw. einer Mannschaft.
_UI_WinnerType_organization_description = Verein, für den ein Wettkämpfer bzw. eine Mannschaft and den Start geht.
_UI_WinnerType_disable_description = Sofern dieser Eintrag nicht leer ist, startet der Wettkämpfer ausser Konkurenz. Im Protokoll werden entsprechende Wettkämpfer am Ende mit Angabe dieses Eintrages aufgelistet. Beispiele sind: 'Ausser Konkurenz', 'Disqualifiziert'
_UI_WinnerType_class_description = Wettkampfklasse in der der Wettkampfteilnehmer startet.
_UI_AthletType_person_description = Referenz auf eine Person. Der Unterschied zwischen Wettkämpfer und Person besteht darin, dass es nur eine Person 'Max Mustermann' geben kann. Es kann aber mehrere Wettkämpfer 'Max Mustermann' geben, z.B. ein 'Max Musterman' der in der Wettkampfklasse 'männlich Kinder KM4' startet und der (gleiche) 'Max Mustermann', der in der Wettkampfklasse 'Jedermannturnen bis 8 Jahre' startet.
_UI_AthletType_team_description = Referenz auf die Mannschaft, für die der Wettkämpfer startet. Der Eintrag kann leer sein, sofern der Wettkämpfer für keine Mannschaft startet.
_UI_AthletType_chain_feature = Chain
_UI_TeamType_athlet_description = Wettkämpfer, die zu einer Mannschaft gehören.
_UI_ChainType_name_description = Name der Riege, beispielsweise 'Riege 1'
_UI_ChainType_athlet_description = Wettkämpfer, die in der Riege sind.
_UI_ChainType_station_description = Geräte, die nacheinander von der Riege angesteuert werden.
_UI_DisziplineType_id_description = Eindeutige, einzigartige Bezeichnung einer Disziplin. Disziplinen unterscheiden sich in Wettkampfklasse und Gerät. Beispiele sind: 'weiblich-kinder-km4-boden', 'finale-weiblich-kinder-km4-boden'. Der Bezeichner darf keine Leerzeichen enthalten und muss mit einem '_' oder Buchstaben beginnen.
_UI_DisziplineType_name_description = Verständlicher Name der Disziplin. Mehrere Disziplinen können den gleichen Namen haben, beispielsweise 'Boden' für die Disziplin in der Wettkampfklasse 'weiblich Kinder KM4' und für die Disziplin in der Wettkampfklasse 'weiblich Kinder P5'
_UI_DisziplineType_station_description = Gerät bzw. Station an dem die Disziplin geturnt wird. Beispielsweise 'Boden 1'
_UI_DisziplineType_lookuptable_description = Umrechnungstabelle, wenn die Punkte Disziplin für die Disziplin nach einer Umrechnungstabelle errechnet werden. Beispiel wenn in der Disziplin 'Sprint 30m' 2 Secunden 10 Punkten entspricht und 5 Sekunden 0 Punkten entspricht. Für einen Gerätturnwettkampf gibt es keine solche Umrechnungstabelle.
_UI_DisziplineType_calculationkey_description = Berechnungsschlüssel, der für diese Disziplin gilt. Gültige Werte sind hier 'force', 'finals', 'lookuptable', 'bjs(\"(lauf)|(.*)\",a,c,d,z)' die entsprechende Wertung muss enthalten sein, auch wenn nur die besten 3 Wertungen genommen werden sollen. 'finals' bedeuted, dass nur die Wertung dieser Disziplin genommen werden soll.
_UI_StationType_id_description = Eindeutige, einzigartige Bezeichnung eines Gerätes bzw. einer Station. Diese Bezeichung wird programmatisch zur Referenzierung verwendet. Beispiele sind: 'station-boden-1', 'station-pause'
_UI_StationType_name_description = Verständlicher Name des Gerätes bzw. der Station. Beispiele sind: 'Boden 1', 'Reck' oder auch 'Pause'
_UI_ResultType_rank_description = Numerischer Wert, der die Plazierung angibt. In der Regel wird diese Plazierung berechnet.
_UI_ResultType_points_description = Zusammengerechnete Punktzahl.
_UI_ResultType_juriresult_description = Einzelwertungen an den Disziplinen.
_UI_JuriResultType_diszipline_description = Referenz auf die Disziplin, für die diese Wertung gilt.
_UI_JuriResultType_value_description = Vergebene Gesamtpunktzahl für diese Disziplin.
_UI_TeamJuriResultType_juriResult_description = Referenz auf die Gerätewertungen der einzelnen Mannschaftswettkämpfer, die für die Berechnung der Mannschaftswertung an einem Gerät betrachtet werden müssen. Bei einer Mannschaftsaufstellung 6-4-3 dürfen hier nur 4 Einzelwertungen referenziert werden.
_UI_JuristType_person_description = Person, die als Kampfrichter fungiert.
_UI_JuristType_organization_description = Verein, von dem der Kampfrichter gestellt wird.
_UI_JuriType_jurist_description = Kampfrichter, die in diesem Kampfgericht wirken.
_UI_JuriType_diszipline_description = Disziplinen, die dieses Kampfgericht bewertet.
_UI_JuriType_name_description = Verständlicher Name des Kampfgerichtes.
_UI_LookupTablesType_table_description = Umrechnungstabellen, die in diesem Wettkampf verwendet werden. Umrechnungstabellen werden bei bestimmten Disziplinen (z.B. Athletikdisziplinen) verwendet. Dabei werden Messwerte linear in Punkte umgerechnet.
_UI_LookupTableType_id_description = Eindeutiger, einzigartiger Bezeichner der Umrechnungstabelle.
_UI_LookupTableType_minVal_description = Messwert, für den (noch) keine Punkte vergeben werden. Dies entspricht 0 Punkten.
_UI_LookupTableType_maxVal_description = Messwert, für den 10 Punkte vergeben wird.
_UI_LookupTableType_disziplines_description = Disziplinen, für die diese Umrechnungstabelle gilt.
